import Proof

arr a b = (AST Arr [a, b])
arr3 a b c = (AST Arr [a, (AST Arr [b, c])])
cnj a b = (AST Conj [a, b])
frl a b = (AST Forall [(AST a []), b])
exi a b = (AST Exists [(AST a []), b])

infixr 4 -->
infixl 6 &&&
infix  7 @@
infix  7 ??
(-->) = arr
(&&&) = cnj
(@@) = frl
(??) = exi

truth = parseStatement "A->A->A"

data TrRes =
      OK [AST]
    | Incorrect Int Cause
data Cause =
      Propagated Proof
    | ErrFreeIn Token AST

isOK (OK a) = True
isOK _ = False

isPropagated (Incorrect _ (Propagated _)) = True
isPropagated _ = False

fromPropagated (Incorrect a (Propagated b)) = (a, b)

isErrFreeIn (Incorrect _ (ErrFreeIn _ _)) = True
isErrFreeIn _ = False

fromErrFreeIn (Incorrect i (ErrFreeIn t a)) = (i, t, a)

simple hyp prn =
    [
        prn,
        truth,
        arr3 prn hyp prn, -- p -> h -> p
        hyp --> prn -- h -> p
    ]
    
    
aThusA e =
    [
        truth,
        arr3 e truth e,
        arr3 truth e truth,
        e --> truth,
        arr3 (e --> truth) (arr3 e truth e) (e --> e),
        (arr3 e truth e) `arr` (e `arr` e),
        e `arr` e
    ]
    
mp l r h =
    [
        -- ~ h --> l,
        -- ~ h --> l --> r,
        (h --> l) --> (h --> l --> r) --> (h --> r),
        (h --> l --> r) --> (h --> r),
        h --> r
    ]
    
    
transform pr@(Axiom i) hyp expr ind =
        OK $ simple hyp expr
transform pr@(Assumption i) hyp expr ind
    | hyp == expr =
        OK $ aThusA expr
    | otherwise =
        OK $ simple hyp expr
transform pr@(MP (left, _) (it, _)) hyp expr ind =
    let (AST Arr [_, r]) = it in
        OK $ mp left r hyp
transform pr@(Rule1 (t, st, i)) hyp expr ind
    | (not $ hasAsFree t hyp) =
        OK $ rule1 st hyp t
    | otherwise =
        Incorrect ind (t `ErrFreeIn` hyp)
transform pr@(Rule2 (t, st, i)) hyp expr ind
    | (not $ hasAsFree t hyp) =
        OK $ rule2 st hyp t
    | otherwise =
        Incorrect ind (t `ErrFreeIn` hyp)
transform pr hyp expr ind =
        Incorrect ind (Propagated pr)
    
        
rule1 st hyp var =
    let (AST _ [l, r]) = st
        sm1 = [hyp, l, r]
        sm2 = [hyp, l, (@@) var r]
    in
        concat [
            map (stupidSubst sm1) first,
            [
                (hyp &&& l) --> r,
                (hyp &&& l) --> ((@@) var r)
            ],
            map (stupidSubst sm2) second,
            [
                hyp --> l --> ((@@) var r)
            ]
        ]
        
rule2 st hyp var =
    let (AST _ [l, r]) = st
        sm1 = [hyp, r, l]
        sm2 = [((??) var l), r, hyp]
    in
        concat [
            map (stupidSubst sm1) third,
            [
                l --> hyp --> r,
                ((??) var l) --> hyp --> r
            ],
            map (stupidSubst sm2) third,
            [
                hyp --> ((??) var l) --> r
            ]
        ]
        
stupidSubst !submap !stmt@(AST (Holder h) _) =
    let i = (read h) - 1
    in
        (submap !! i)
stupidSubst !submap !stmt@(AST t es) =
    (AST t (map (stupidSubst submap) es))
        
        
        
